import "./Login.css";
import Form from "../../Components/Form/Form";
import Button from "../../Components/Button/Button";

export default function Login() {
  return (
    <div>
      <div className="form">
        <div className="content">
          <Form type="text" place="Login With E-Mail" class="label1" />
          <br></br>
          <Form type="text" place="Type Your PassWord" />
          <br></br>
          <Form type="number" place="Your Age" input="age" />
          <br></br>
        </div>
      </div>
    </div>
  );
}
